    false,nt"url": null,nt"notes": "This annual narrative report for Koyukuk
    NWR outlines Refuge accomplishments during the 1988 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. Land acquisition
    is covered. The report includes a planning section which discusses management planning
    and research and investigations. Refuge administration is outlined; information
    about personnel, volunteer programs, funding, safety, and technical assistance is
    given. Habitat management is also covered; subjects include wetlands, forests, fire
    management, and wilderness areas. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
    shorebirds, raptors, game mammals, fisheries resources, and marking and bird banding.
    The public uses of the Refuge described in this report include hunting, fishing,
    trapping, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, major maintenance, equipment replacement,
    and communication systems.",nt"license_title": "License Not Specified",nt"extras":
